import React from "react";
import Pagination from "../Pagination/Pagination";
import CarouselItem from "../CarouselItem/CarouselItem";
const songnew = {
    title: "Nhạc mới mỗi ngày",
    list: [
      {
        author: "Nguyên Hà, Đức Phúc, Bích Phương...",
        name: "Nhạc Việt Tháng 10/2021",
        img: "https://photo-resize-zmp3.zadn.vn/w320_r1x1_jpeg/cover/d/7/9/8/d798005f023c4815333bd1e2c1f5ce54.jpg",
      },
      {
        author: "Nguyên Hà, Đức Phúc, Bích Phương...",
        name: "Nhạc Việt Tháng 10/2021",
        img: "https://photo-resize-zmp3.zadn.vn/w320_r1x1_jpeg/cover/d/7/9/8/d798005f023c4815333bd1e2c1f5ce54.jpg",
      },
      {
        author: "Nguyên Hà, Đức Phúc, Bích Phương...",
        name: "Nhạc Việt Tháng 10/2021",
        img: "https://photo-resize-zmp3.zadn.vn/w320_r1x1_jpeg/cover/d/7/9/8/d798005f023c4815333bd1e2c1f5ce54.jpg",
      },
      {
        author: "Nguyên Hà, Đức Phúc, Bích Phương...",
        name: "Nhạc Việt Tháng 10/2021",
        img: "https://photo-resize-zmp3.zadn.vn/w320_r1x1_jpeg/cover/d/7/9/8/d798005f023c4815333bd1e2c1f5ce54.jpg",
      },
      {
        author: "Nguyên Hà, Đức Phúc, Bích Phương...",
        name: "Nhạc Việt Tháng 10/2021",
        img: "https://photo-resize-zmp3.zadn.vn/w320_r1x1_jpeg/cover/d/7/9/8/d798005f023c4815333bd1e2c1f5ce54.jpg",
      },
    ]
  };
  function CarouselSongNew(){
      return(
          <>
          <div className="CarouselTitle">
        <p className="CarouselText">{songnew.title}</p>
        <Pagination />
      </div>
      <div className="Carousel">
        {songnew.list.map((item) => (
          <CarouselItem item={item} />
        ))}
      </div>
          </>
      )
  }
  export default CarouselSongNew;
